import './App.css';
import Header from './components/Header';
import Body from './components/Body';
import Footer from './components/Footer';
import {BrowserRouter, Routes} from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>
        <Route>
          <Body/>
        </Route>
        </Routes>
      <Footer/>      
    </div>
  );
}

export default App;
